import Link from 'next/link';
import {ListGroupItemHeading, ListGroupItemText, ListGroup, ListGroupItem, NavLink} from "reactstrap"

const QuestionList = (props) => (
	<div>
		{
		props.list.map(item => (
			<div>
			
			    <ListGroup>
			      <ListGroupItem>
			        <NavLink href={`${item.url}`}>
			        <ListGroupItemHeading>{ item.question }</ListGroupItemHeading>
			        <ListGroupItemText>
						{ item.published_at }
			        </ListGroupItemText>
			        </NavLink>
			      </ListGroupItem>
			    </ListGroup>

			</div>
			))		
		}
	</div>
);

export default QuestionList;
